import React, { useEffect } from "react";
import Navbar from "../../components/Navbar";
// formik
import { Formik, Field, Form } from "formik";

function Login() {
  useEffect(() => {
    document.title = "Admin | Login";
  });

  return (
    <div className="min-h-screen max-w-2xl mx-auto font-inter">
      <Navbar />
      <div className="w-full max-w-md px-6 py-8 bg-white dark:bg-gray-800 shadow-lg rounded-xl px-6 py-12 mt-32">
        <h2 className="text-2xl font-bold text-gray-900 dark:text-gray-100 text-center mb-6">
          Admin Girişi
        </h2>
        <Formik
          initialValues={{ name: "", email: "" }}
          onSubmit={async (values) => {
            await new Promise((resolve) => setTimeout(resolve, 500));
            alert(JSON.stringify(values, null, 2));
          }}
        >
          <Form className="flex flex-col space-y-4">
            <div>
              <label className="block text-gray-700 dark:text-gray-300 mb-1">
                Kullanıcı Adı
              </label>
              <Field
                name="name"
                type="text"
                className="w-full px-4 py-2 border rounded-lg focus:ring  dark:bg-gray-700 dark:border-gray-600 dark:text-gray-200"
              />
            </div>

            <div>
              <label className="block text-gray-700 dark:text-gray-300 mb-1">
                Email
              </label>
              <Field
                name="email"
                type="email"
                className="w-full px-4 py-2 border rounded-lg focus:ring  dark:bg-gray-700 dark:border-gray-600 dark:text-gray-200"
              />
            </div>

            <button
              type="submit"
              className="w-full bg-blue-600 hover:bg-blue-700 text-white font-semibold py-2 rounded-lg transition"
            >
              Giriş Yap
            </button>
          </Form>
        </Formik>
      </div>
    </div>
  );
}

export default Login;
